import '../home/home.css';
import imagenFondo from '../../img/fondohome3.jpg';
import {  useDispatch, useSelector} from "react-redux";
import { useEffect } from "react";
import {getAllRace} from '../../Redux/actions';





export default function Home() {

const state = useSelector(state => state.payload.breedAll)
const dispatch = useDispatch();

useEffect (()=> {                   //trae del estado las razas cuando el componente se monta
  dispatch (getAllRace())
}, [dispatch]) 

return (
    <div className="text"> 
      <h1 className="title">Universe of Dogs</h1>
      <img src={imagenFondo} alt="unirverse of Dog" className='imagefondo' />  
      <button onClick={getAllRace}className="btn-search">buscar Perros</button>
    </div>
  );
}
